var server=null;var meta={ready:false};$(document).ready(function(){if(production){server=new WebSocket("some production url");}
else{server=new WebSocket("ws://localhost:8000/game/"+matchid+'/ws');}
server.onmessage=onmessage;$("#start").click(function(){if(meta.ready){meta.ready=false;server.send(JSON.stringify({m:'unready'}));}
else{meta.ready=true;server.send(JSON.stringify({m:'ready'}));}});})
function onmessage(event){var data=JSON.parse(event.data);console.log(event);}